import React from 'react';
import ReactDOM from 'react-dom';

async function GetData(){
  const response = await fetch('drinks.csv');
  const data = await response.toString();
  
    const row = data.split('\n').slice(1);

      Array.prototype.forEach.call(data.row, row => {
          const columns = row.split(',');
          const country = columns[0];
          const beer = columns[1];
          const spirit = columns[2];
          const wine = columns[3];
          const total = columns[4];
      })
      console.log(data);

    function DataList (props){
        const data = props.data;
        const listRows = data. map((columns) =>
            <li>{columns}</li>
        );
        return(
            <ul>{listRows}</ul>
        )
    }
    
    
    
    ReactDOM.render(
        <GetData data = {data} />,
        document.getElementById('root')
    );
    
  }

  export default GetData;
